  client.hset('HolbertonSchools', 'New York', 20, (err, resp) => {
    if (err) {
      console.log('Error setting New York: ', err);
    } else {
      console.log('Reply: ', resp);
    }
  });
  client.hset('HolbertonSchools', 'Bogota', 20, (err, resp) => {
    if (err) {
      console.log('Error setting Bogota: ', err);
